    if (lexerState.wantsDefOrMacroName) return handle(CR_DIV_OP);
    if (lexerState.slashIsRegex) return startRegex();
    if (eof() || isAsciiWhitespace(zzBuffer.charAt(zzMarkedPos))) return handle(CR_DIV_OP);
